import React from 'react';
import './header.css';

export function Header()
:  JSX.Element
{
	return (
		<div id="header">
			<div id="P">P</div>
			<div id="O">O</div>
			<div id="N">N</div>
			<div id="G">G</div>
		</div>
	);
}
